t_id_str == '' or token_str == '' then return end    effilTelegramSendMessage(url_encode(u8:encode(text)), chat_id_str, token_str)endfunction main()    while not isSampAvailable() do wait(0) end    sampAddChatMessage('{3083ff}[ItemLog] {ffffff}Активация: /item', -1)    sampRegisterChatCommand('item', function() window[0] = not window[0] end)    sampRegisterChatCommand('itemupdate', function() checkUpdate(true) end)        -- Фоновая проверка обновления при запуске    lua_thread.create(function() checkUpdate(false) end)    wait(-1)endfunction checkUpdate(manual)    if UPDATE_URL == "" then         if manual then sampAddChatMessage("[ItemLog] Ошибка: URL для обновлений не указан в коде.", -1) end        return     end    local requests = require('requests')    local ok, response = pcall(requests.get, UPDATE_URL)    if ok and response.status_code == 200 then        local remote_version = response.text:match('local SCRIPT_VERSION = "(.-)"')        if remote_version and remote_version ~= SCRIPT_VERSION then            sampAddChatMessage("[ItemLog] Найдена новая версия " .. remote_version .. ". Обновляю...", -1)            local file = io.open(thisScript().path, "w")            if file then                file:write(response.text)                file:close()                sampAddChatMessage("[ItemLog] Обновлено! Перезагрузка...", -1)                thisScript():reload()            end        elseif manual then sampAddChatMessage("[ItemLog] У вас последняя версия.", -1) end    elseif manual then sampAddChatMessage("[ItemLog] Ошибка проверки обновлений.", -1) endendimgui.OnFrame(function() return window[0] end, function()    local resX, resY = getScreenResolution()    imgui.SetNextWindowPos(imgui.ImVec2(resX / 2, resY / 2), imgui.Cond.FirstUseEver, imgui.ImVec2(0.5, 0.5))    imgui.SetNextWindowSize(imgui.ImVec2(400, 350), imgui.Cond.FirstUseEver)    imgui.Begin('ItemLog ' .. SCRIPT_VERSION, window, imgui.WindowFlags.NoResize)    if imgui.Button(u8"Уведомления", imgui.ImVec2(120, 25)) then activeTab[0] = 1 end    imgui.SameLine(); if imgui.Button(u8"Настройки", imgui.ImVec2(120, 25)) then activeTab[0] = 2 end    imgui.SameLine(); if imgui.Button(u8"Инфо", imgui.ImVec2(120, 25)) then activeTab[0] = 3 end    imgui.Separator()    if activeTab[0] == 1 then        imgui.Checkbox(u8('Оповещение о добавлении'), itemAdding)        cfg.config.itemAdding = itemAdding[0]        imgui.Checkbox(u8('Уведомлять о неизвестных'), sendUnknownItems)        cfg.config.sendUnknownItems = sendUnknownItems[0]        inicfg.save(cfg, SCRIPT_CONFIG_FILENAME)        imgui.Text(u8"База предметов:")        imgui.BeginChild("item_list", imgui.ImVec2(0, 180), true)        for _, id in ipairs(items) do            imgui.TextColored(imgui.ImVec4(0.2, 0.5, 1.0, 1.0), "["..id.."]")            imgui.SameLine(); imgui.Text(u8(items_name[id] or "Unknown"))        end        imgui.EndChild()    elseif activeTab[0] == 2 then        if imgui.InputText(u8('ID Чата'), chat, ffi.sizeof(chat)) then cfg.config.chat = ffi.string(chat) end        if imgui.InputText(u8('Токен'), token, ffi.sizeof(token), imgui.InputTextFlags.Password) then cfg.config.token = ffi.string(token) end        inicfg.save(cfg, SCRIPT_CONFIG_FILENAME)        if imgui.Button(u8"Тест Telegram", imgui.ImVec2(-1, 30)) then sendTelegramMessage("Тест") end    elseif activeTab[0] == 3 then        imgui.Text(u8"Версия: " .. SCRIPT_VERSION)        if imgui.Button(u8"Проверить обновление сейчас", imgui.ImVec2(-1, 30)) then checkUpdate(true) end    end    imgui.End()end)function samp.onServerMessage(color, text)    if color == -65281 and itemAdding[0] then        if text:find("Вам был добавлен предмет") and text:find("Откройте инвентарь") then            local itemId = tonumber(text:match(":item(%d+):"))            if itemId then                if items_name[itemId] then sendTelegramMessage("Вы получили предмет\n" .. items_name[itemId])                elseif sendUnknownItems[0] then sendTelegramMessage("Вы получили неизвестный предмет\nID: ".. itemId) end            end        end    endend